  `hyper_lrm` json DEFAULT NULL COMMENT '\nnumSteps: int>=[1] number of steps in LRM solver\nlearningRate: invalid lhs >= rhs markdown LRM learning rate\n',
  `hyper_pls` json DEFAULT NULL COMMENT '\nlatentVectors: invalid lhs >= rhs markdown number of pls latenent vectors\ntolerance: invalid lhs >= rhs markdown tolerance\n',
  `hyper_ols` json DEFAULT NULL COMMENT '\ndegree: invalid lhs >= rhs markdown Maximum degree of the polynomial (0=linear ols)\n',
  `hyper_knn` json DEFAULT NULL COMMENT '\nk: invalid lhs >= rhs markdown Number of nearest neighbors to use in knn majority voting.\n',
  `hyper_eln` json DEFAULT NULL COMMENT '\nalpha: invalid lhs >= rhs markdown [1] Constant that multiplies the penalty terms. See the notes for the exact mathematical meaning of this parameter. alpha = 0 is equivalent to an ordinary least square, solved by the LinearRegression object. For numerical reasons, using alpha = 0 with the Lasso object is not advised.\ninvalid lhs 0<= rhs markdown [0.5] <=1 Mixing parameter.  For l1_ratio = 0 the penalty is an L2 penalty. For l1_ratio = 1 it is an L1 penalty. For 0 < l1_ratio < 1, the penalty is a combination of L1 and L2.\n',
  `hyper_las` json DEFAULT NULL COMMENT '\nalpha: float>=0 [1] Constant that multiplies the L1 term. alpha = 0 is equivalent to an ordinary least square, solved by LinearRegression.\nnormalize : [False | True].  Ignored when fit_intercept is set to False. If True, the regressors X will be normalized before regression by subtracting the mean and dividing by the l2-norm.\nmax_iter: invalid lhs >= rhs markdown Maximum number of it Regressionerations.\ntol: invalid lhs >= rhs markdown Optional tolerance for the optimization: if the updates are smaller than tol, the optimization code checks the dual gap for optimality and continues until it is smaller than tol.\n',
  `hyper_brr` json DEFAULT NULL COMMENT '\nn_iter: int >=1 [300] Maximum number of iterations.\nalpha_1: float [1e66] shape parameter for the Gamma distribution prior over the alpha parameter.\nalpha_2: float [1e-6] inverse scale parameter (rate parameter) for the Gamma distribution prior over the alpha parameter.\nlambda_1: float [1e-6] shape parameter for the Gamma distribution prior over the lambda parameter.\nlambda_2: float [1e-6] inverse scale parameter (rate parameter) for the Gamma distribution prior.\n',
  `hyper_som` json DEFAULT NULL COMMENT '\niterations: invalid lhs >= rhs markdown [10] Number of iterations over the training set for the training phase. The total number of training steps will be iterations x trainingSet.length.\nlearningRate: float>=0 [0.1] Multiplication coefficient for the learning algorithm.\nmethod: [random | ...] Iteration method of the learning algorithm (default: random)\n',
  `hyper_dtr` json DEFAULT NULL COMMENT '\nlatentVectors: int >=[1] Number of latent vectors\ninvalid lhs float>= rhs markdown tolerance\n',
  `hyper_svm` json DEFAULT NULL,
  `hyper_raf` json DEFAULT NULL,
  `Save_raf` json DEFAULT NULL COMMENT 'raf model',
  `Save_eln` json DEFAULT NULL COMMENT 'eln model',
  `Save_brr` json DEFAULT NULL COMMENT 'brr model',
  `Save_dtr` json DEFAULT NULL COMMENT 'dtr model',
  `Save_lrm` json DEFAULT NULL COMMENT 'lrm model',
  `Save_svm` json DEFAULT NULL COMMENT 'svm model',
  `Save_pls` json DEFAULT NULL COMMENT 'pls model',
  `Save_knn` json DEFAULT NULL COMMENT 'knn model',
  `Save_som` json DEFAULT NULL COMMENT 'som model',
  `Save_ols` json DEFAULT NULL COMMENT 'ols model',
  `Save_las` json DEFAULT NULL COMMENT 'lasso model',
  `Save_predict` json DEFAULT NULL COMMENT 'predictions stash',
  `Save_train` json DEFAULT NULL COMMENT 'training stash',
  `Save_jpg` json DEFAULT NULL COMMENT 'remainder stash',
  `Pipe` json DEFAULT NULL COMMENT '\nPlace a DATASET into a supervised workflow using the Pipe:<pre ><code >	"DATASET.TYPE?QUERY"  \n	{ "path": "DATASET.TYPE?QUERY", "KEY": [VALUE, ...] , ... "norun": true }\n</code></pre>The 2nd-form generates usecases over the specified context KEYs.  The 1st-form selects the\nworkflow based on TYPE = json || jpg || stream || txt || CASE using TYPE-specific <a href=''/api.view'' >QUERY filter keys</a> \nand TYPE-specific <a href=''/api.view'' >supervisor context keys</a>.\n\nThe following context keys are accepted:<pre ><code >	x = [...], y = [...]				// training mode\n	x = [...]							// predict mode\n	xy = { x: [...] , y: [...} } 		// training mode\n	multi = { x: [ [...]...], y: [ [...]...], x0: [ [...]...] } 	// multichannel training mode \n	unsup = [...] 							// unsupervised training mode\n</code></pre>',
  `Description` mediumtext COMMENT '\nDocument your usecase using markdown tags:<pre ><code >	[ TEXT ] ( PATH.TYPE ? w=WIDTH & h=HEIGHT & x=KEY$INDEX & y=KEY$INDEX ... )  \n	[ TEXT ] ( COLOR )  \n	[ TOPIC ] ( ? starts=DATE & ends=DATE )  \n	$ $ inline TeX $ $  ||  n$ $ break TeX $ $ || a$ $ AsciiMath $ $ || m$ $ MathML $ $  \n	[JS || #JS || TeX] OP= [JS || #JS || TeX]  \n	$ { KEY } || $ { JS } || $ {doc( JS , "INDEX" )}  \n	KEY,X,Y >= SKIN,WIDTH,HEIGHT,OPTS  \n	KEY <= VALUE || OP <= EXPR(lhs),EXPR(rhs)  \n</code></pre>',
  `Method` varchar(16) DEFAULT 'ols' COMMENT 'regression technique to USE = lrm | svm | pls | knn	| ols | ...',
  `hyper_qda` json DEFAULT NULL,
  `Save_qda` json DEFAULT NULL,
  UNIQUE KEY `ID` (`ID`),
  UNIQUE KEY `Name` (`Name`)
) ENGINE=InnoDB AUTO_INCREMENT=183 DEFAULT CHARSET=latin1;
